Find all the bots with #height set to 1 and #color set to red.
const bots = getBots(byMod({
    height: 1,
    color: "red"
}));

Find all the bots with #height set to 1 and #color set to red.
const bots = getBots(byMod({
    height: 1,
    color: "red"
}));

Find all bots with the #name bob or a #height of 2
const bots = getBots(
    either(
        byTag("#name", "bob"),
        byTag("height", 2)
    )
);

